import { Route, Routes } from 'react-router-dom';
import './App.css';
import HomeFile from './Component/Home/HomeFile';
import NavBar from './Component/NavBar/NavBarFile';

function App() {
  return (
    <div className="App">
      <Routes>
        {/* Define the route for the HomeFile component */}
        <Route path="/" element={<HomeFile />} />
      </Routes>
    </div>
  );
}

export default App;
